Left 4 Dead 2 with SFK patches to play it online FREE OF COST.

For help see the read me.txt!

Change your nick to whatever you want through rev.ini when asked.

Install tunngle. Register. Type &quot;left&quot; in the search box in Tunngle and select &quot;Left 4 dead 2&quot; network.

Let it load. Then beside the chat box you'll see a cursor like button. Right Click on it and select the Left4Dead2.exe from your program files.

If the game doesn't start. Go to the left4dead2 installed folder. Right click on the .exe file and then properties and select &quot;run this file in admin mode&quot;

And if parameters are asked type &quot;-steam&quot;.

Thats it. When you log in through tunngle you'll automatically see the servers in the game.

